import React from 'react';
import banner from '../assets/images/banner.png'; // Chemin relatif vers l'image

const Home = () => {
  return (
    <div>
      <h1>Welcome to Kasa</h1>
      <img src={banner} alt="Kasa banner" />
    </div>
  );
};

export default Home;
